/**
 * Helper functions
 */
export const getMedicalServiceCategories = (): string[] => {
  const categories = medicalServicePrices.map(service => service.category);
  return [...new Set(categories)].sort();
};

export const getVaccineManufacturers = (): string[] => {
  const manufacturers = vaccinePrices.map(vaccine => vaccine.manufacturer);
  return [...new Set(manufacturers)].sort();
};

export const getDrugCategories = (): string[] => {
  const categories = drugPrices.map(drug => drug.category);
  return [...new Set(categories)].sort();
}; 